Implementing the + operator overload for the ComplexNumber object, in line with the Udemy tutorial. For some reason this was not working when I did it in the way the tutorial did. With some debugging and experimentation, I got it working. When I built the following, I would get an error:

cout << c1 + c2 << endl;

Same issue when I used (c1 + c2). However, there is no problem with building and running the following:

ComplexNumber c3 = c1 + c2;
cout << c3 << endl;

Confusing, but will look into it when I have more time available.
